import React from "react";

import Logo from "../../../components/Logo";
import InputBox from "./InputBox";
import { FormGroup } from "react-bootstrap";

class Body extends React.Component {
  render() {
    return (
      <FormGroup>
        <Logo />
        <InputBox />
        <div>eloo</div>
      </FormGroup>
    );
  }
}
export default Body;
